import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { loginUser } from '../components/redux/features/AuthSlice';
import CustomBackDrop from '../components/UI/CustomBackDrop';
import CustomSnackBar from '../components/UI/CustomSnackBar';
import video from "../assets/form_video.mp4"
import { LoginFormSchema } from '../components/UI/formValidation/LoginFormSchema';
import './login.css';

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const [snackbarOpen, setSnackbarOpen] = useState(false);
  const [snackbarMessage, setSnackbarMessage] = useState('');
  const [snackbarSeverity, setSnackbarSeverity] = useState('success');
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const authState = useSelector((state) => state.data.auth);

  const handleSubmit = async (e) => {
    e.preventDefault();
    // if (!email || !password) {
    //   setError('Please fill in both fields.');
    //   return;
    // }
    try {
      const validatedData = LoginFormSchema.parse({ email, password });
      setLoading(true);
      await dispatch(loginUser(validatedData)).unwrap();
      setSnackbarMessage('Login successful!');
      setSnackbarSeverity('success');
      setSnackbarOpen(true);
      setLoading(false);
      navigate('/');
    } catch (err) {
      if (err.errors[0]?.path[0] === 'email') {
        setError('Invalid email. Please enter a valid email.');
      } else if (err.errors[0]?.path[0] === 'password') {
        setError('Invalid password. Please enter a valid password.');
      } 
      else {
        setError(authState.error || 'Invalid email or password. Please try again.');
      }
      setSnackbarMessage(error);
      setSnackbarSeverity('error');
      setSnackbarOpen(true);
      setLoading(false);
    }
  };

  const handleSnackbarClose = (event, reason) => {
    if (reason === 'clickaway') {
      return;
    }
    setSnackbarOpen(false);
  };

  return (
    <div className="login-page-container">
      <div className="video-container">
        <video autoPlay muted loop>
          <source src={video} type="video/mp4" />
        </video>
      </div>
      <div className="auth-form-container">
        <h2>LOGIN</h2>
        <p>Please Enter your Email and Password!</p>

        <form className="login_form" onSubmit={handleSubmit}>
          {error && <p className="error-message">{error}</p>}
          
          <div className="input-group">
            <input
              type='email'
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <label>Email</label>
          </div>

          <div className="input-group">
            <input
              type='password'
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <label>Password</label>
          </div>

          <div>
            <button className='login_btn' type="submit">Login</button>
          </div>

          <div className="form-links">
            <p>Don't have an account? <Link to="/signup">Sign Up</Link></p>
            <p>Don't remember password? <Link to="/resetpassword">Reset Password</Link></p>
          </div>
        </form>

        <CustomBackDrop loading={loading} />
        
        <CustomSnackBar 
          snackbarOpen={snackbarOpen} 
          handleSnackbarClose={handleSnackbarClose} 
          snackbarSeverity={snackbarSeverity} 
          snackbarMessage={snackbarMessage} 
        />
      </div>
    </div>
  );
}

export default Login;
